// ==UserScript==
// @name         Scatbooru Infinite Scroll
// @namespace    http://tampermonkey.net/
// @version      0.7
// @description  Adds an infinite scroll toogle at the bottom of the sidebar
// @author       BicHD
// @match        https://scatbooru.co.uk/*page=post*
// @icon         https://www.google.com/s2/favicons?sz=64&domain=scatbooru.co.uk
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/454373/Scatbooru%20Infinite%20Scroll.user.js
// @updateURL https://update.greasyfork.org/scripts/454373/Scatbooru%20Infinite%20Scroll.meta.js
// ==/UserScript==

document.querySelector(".sidebar > :last-child").innerHTML += "<div style='margin-bottom: 1em;'><h5>Infinite Scroll</h5><ul><li><a href='#' id='scroll-toggle'>Enabled: <span data-role='toggle-button-label'>Off</span></a></li><li><span id='page-info'></span></li></ul></div>"
document.querySelector("#paginator").outerHTML += '<div id="loading-scat" style="display: none;margin-left: auto;margin-right: auto;width: max-content;"><img src="data:image/png;base64," style="width: 60px;margin-left: auto;margin-right: auto;display: block;"><span style="display: block;">Loading scat...</span></div>'

document.querySelector("#scroll-toggle").addEventListener('click', scrollToggle)

function isNearBottom() {
    var scrollTop
    if (typeof pageYOffset != "undefined") {
        scrollTop = pageYOffset
    } else {
        var B = document.body
        var D = document.documentElement
        D = (D.clientHeight) ? D : B
        scrollTop = D.scrollTop
    }
    return document.documentElement.offsetHeight - document.documentElement.clientHeight - scrollTop < 58
}

function scrollToggle(){
    if(typeof event === "undefined")
    {
        var event = window.event
        }
    event.preventDefault()
    var toggleState = ({"on":true,"off":false})[document.querySelector("[data-role='toggle-button-label']").innerText.toLowerCase()]
    document.querySelector("[data-role='toggle-button-label']").innerText = !(toggleState) ? "On" : "Off"
    document.getElementById("paginator").style.display = !(toggleState) ? "none" : "block"
    document.cookie = "infinite_scroll="+(!(toggleState) ? "1" : "0")
    handler()
}

async function nextPage(query) {
    document.getElementById("loading-scat").style.display = "block"
    var response = await fetch(new URL(location.pathname, location.href).href+"?"+query).catch(function(error) {cursor -= pageSize})
    var html = new DOMParser().parseFromString(await response.text(), 'text/html')
    var elements = html.querySelectorAll(".content > div:first-child > .thumb")
    if (elements.length < pageSize) {
        document.removeEventListener("scrollend", insertPosts)
        document.querySelector("#loading-scat img").style.display = "none"
        document.querySelector("#loading-scat span").innerText = "End of results."
    }
    document.querySelector("#paginator").innerHTML = html.querySelector("#paginator").innerHTML
    updateOnPageLoaded(pageID+1)
    pageID += 1
    document.getElementById("loading-scat").style.display = "none"
    return elements
}

async function insertPosts(){
    if (document.getElementById("loading-scat").style.display == "block") {
        return
    }
    if (isNearBottom()) {
        params.set("pid",cursor += pageSize)
        var postsHTML = await nextPage(params.toString())
        if (typeof postsHTML == 'undefined') {
            return
        }
        postsHTML.forEach(function(e){
            var c = e.querySelector("script").innerHTML.match(/\[(\d+)\] = ([^}]+})/)
            posts[c[1]] = eval("("+c[2]+")")
            document.querySelector(".content > div:first-child > .thumb:last-of-type")
                .after(e)})
        window.posts = posts
    }
}

function handler() {
    if (document.querySelector('#paginator > select > option:only-child') || !document.querySelector('#paginator > a[alt="last page"]')) return
    if (document.cookie.includes("infinite_scroll")) {
        if (!!+document.cookie.match(/infinite_scroll=(.*?)(?:$|;)/)[1]) {
            if (document.getElementById("loading-scat").style.display == "block") return
            document.addEventListener("scroll", stickSidebar)
            document.addEventListener("scroll", insertPosts)
            if (!(document.body.scrollHeight > window.innerHeight)) insertPosts()
        } else {
            document.removeEventListener("scroll", stickSidebar)
            document.removeEventListener("scroll", insertPosts)
        }
    } else {
        document.cookie = "infinite_scroll="+(!(!!+document.querySelector("[data-role='toggle-button-label']").innerText) ? "1" : "0")
        handler()
    }
}

function stickSidebar() {
    var window_top = window.pageYOffset;
    var div_top = document.querySelector("#content").offsetTop;
    if (window_top > div_top) {
        document.querySelector(".content").style.paddingLeft = document.querySelector(".sidebar").offsetWidth+"px"
        document.querySelector(".sidebar").style.position = "fixed"
        document.querySelector(".sidebar").style.top = 0
        document.querySelector(".sidebar").style.bottom = 0
        document.querySelector(".sidebar").style.overflow = "scroll"
    } else {
        document.querySelector(".sidebar").style.position = ""
        document.querySelector(".sidebar").style.top = ""
        document.querySelector(".sidebar").style.bottom = ""
        document.querySelector(".sidebar").style.overflow = ""
        document.querySelector(".content").style.paddingLeft = ""
    }
}

var params = new URLSearchParams(window.location.search)
var cursor = parseInt(params.get("pid")) || 0
var pageSize = document.querySelectorAll(".thumb").length
var pageID = Number(document.querySelector("#paginator [selected]").innerText)
var firstPageIDs = []
var postIDdict = {}
var posts = {}
document.querySelectorAll(".content > div:first-child > .thumb").forEach(post => {
    var c = post.outerHTML.match(/\[(\d+)\] = ([^}]+})/)
    posts[c[1]] = eval("("+c[2]+")")})

function getAnchorHTMLCode(pageID) {
    var code = "<a href=\"{URL}\">[{PAGE_ID}]</a>";
    code = code.split("{URL}").join(postIDdict[pageID]);
    code = code.split("{PAGE_ID}").join(pageID);
    return code;
}


function updateOnPageLoaded(pageID) {
    var lastPageID = null;
    postIDdict[pageID] = "?"+params.toString()
    if (firstPageIDs.length < 3) {
        firstPageIDs.push(pageID);
    } else {
        lastPageID = pageID;
    }

    var anchors = [];
    firstPageIDs.forEach(function(e){anchors.push(getAnchorHTMLCode(e))})

    var code = "";
    code += "Pages: ";
    code += anchors.join(", ");

    if (lastPageID) {
        code += " ... " + getAnchorHTMLCode(lastPageID);
    }

    document.getElementById("page-info").innerHTML = code
}

if (document.cookie.includes("infinite_scroll")) {
    if (!!+document.cookie.match(/infinite_scroll=(.*?)(?:$|;)/)[1]) {
        document.getElementById("paginator").style.display = "none"
        document.querySelector("[data-role='toggle-button-label']").innerText = "On"
        handler()
    }
}